  import scala.collection.mutable.Stack

/*the number of numbers smaller than lim divisible with any of List(p1...pk)
 * these are | U_i {n | n<lim && pi/n} |,
 * which we compute with the inclusion exclusion principle: \sum_i | {n | pi/n} | - \sum_{i,j} | {n | pipj/n} |  + \sum_{i,j,k} | {n | pipjpk/n} | - ...
 */ 

def nWaysDiv(p: List[Int], lim: Int) = {
  val l = p.length
  var nw = 0
  val s = new Stack[(List[Int],Int,Int)] 
  List.range(0,l).foreach{
    i => 
      s.push((List(i), 1, lim/p(i)))      
  }
  var j = 0
  while (!s.isEmpty) {
    val (li, sg, v) = s.pop
    if (sg % 2 == 1) nw += v else nw -= v
    j = li.last + 1    
    while (j < l && v/p(j) > 0) {
      s.push((li:+j, sg + 1, v/p(j)))
      j += 1
    }
  } 
  println("the number of numbers smaller than " + lim + " divisible with any of " + p + " is " + nw)
  nw
}

/*the number of numbers smaller than lim which have no prime factor in List p */
def nWaysNoDiv(p: List[Int], lim: Int) = lim - nWaysDiv(p, lim)

def gcd(a: Int, b: Int): Int = if(b == 0) a else gcd(b, a % b)

/*the number of numbers smaller than lim which have at most one prime factor in list p
 * is the number of numbers minus those that have any in f = {pipj | i <= j}
 */
def nWays1Div(f: List[Int], lim: Int) = { //p.foldLeft(0)((r, pi) => r + nWaysDiv((p - pi).toList.sorted.takeWhile(_<lim/pi), lim/pi))
  val l = f.length
  var nw = 0
  val s = new Stack[(List[Int],Int,Int,Int)] 
  List.range(0,l).foreach{
    i => 
      s.push((List(i), 1, f(i), lim/f(i)))      
  }
  var j = 0
  while (!s.isEmpty) {
    val (li, sg, fc, v) = s.pop
    if (sg % 2 == 1) nw += v else nw -= v
    j = li.last + 1    
    while (j < l && v*gcd(f(j),fc)/f(j) > 0) {
      s.push((li:+j, sg + 1, f(j), v*gcd(f(j),fc)/f(j)))
      j += 1
    }
  } 
  println("the number of numbers smaller than " + lim + " divisible with any of " + f + " is " + nw)
  nw
}

